    /**
     * Gets the attribute value for the calculated attribute TransSupNme.
     * @return the TransSupNme
     */
    public String getTransSupNme() {
        if(getEoId() !=null)
        {
           
            ViewObjectImpl wsShiftimpl = getAm().getLOVSupplierVO1();
           
            String shiftName = null ;
            Row[] filteredRows = wsShiftimpl.getFilteredRows("EoId", getEoId());
            
            if(filteredRows.length >0)
            {
                if(filteredRows[0].getAttribute("EoNm") != null){
                     shiftName =  filteredRows[0].getAttribute("EoNm").toString();
                   // portcode =  filteredRows[0].getAttribute("PortCode").toString();
                    //System.out.println("Employee name is : " + shiftName);
                }
            }

            return shiftName;
        }
        return (String) getAttributeInternal(TRANSSUPNME);
    }

